import React, { useState } from "react";
import FlexBox from "./FlexBox";

const Header = () => {
    const [tabCurrent, setTabCurrent] = useState(0);
    const headerMenu = [
        {
            index: 0,
            title: "메인",
        },
        {
            index: 1,
            title: "게시판",
            subMenu: [
                { index: 0, subTitle: "자유" },
                { index: 1, subTitle: "서울" },
                { index: 2, subTitle: "부산" },
                { index: 3, subTitle: "울산" },
                { index: 4, subTitle: "경남" },
            ],
        },
        {
            index: 2,
            title: "자취생활",
            subMenu: [
                { index: 0, subTitle: "청소" },
                { index: 1, subTitle: "세탁" },
                { index: 2, subTitle: "요리" },
                { index: 3, subTitle: "건강" },
                { index: 4, subTitle: "기타" },
            ],
        },
    ];

    return (
        <FlexBox justify="space-between">
            <div>gdgd</div>
            <div>qdqd</div>
        </FlexBox>
    );
};

export default Header;
